class Contact {
    constructor (id, profile, firstname, lastname, email, phone) {
        this.id = id;
        this.profile = profile;
        this.firstname = firstname;
        this.lastname = lastname;
        this.email = email;
        this.phone = phone;
    }

    presentation = () => {
        alert(`
            Bonjour,
            Je m'appelle ${this.firstname + " " + this.lastname}.
            Je suis joingnable au ${this.phone}, ou par mail Ã  l'adresse suivante : ${this.email}.
            Cordialement.
            `);
    }
    renderContact = function() {};
}

