class ContactsList {

    constructor (list) {
        this.list = list;
    }
    
    add = function (contact) {
        this.list.push(contact);
    };
    
    remove = function (contact) {
        this.list = this.list.filter(c => c.id !== contact.id);
    };
    
    save = function (key) {
        try {
            localStorage.setItem(key, JSON.stringify(this.list));
        } catch (e) {
            if (e == QUOTA_EXCEEDED_ERR) {
                alert("LocalStorage : Quota exceeded")
            }
        }
    };
    
    loadMocks = function(mocks) {
        mocks.forEach(contact => {
            if (contact.hasOwnProperty("organisation")) {
                this.add(new ContactPro(contact.id, contact.profile, contact.firstname, contact.lastname, contact.phone, contact.email, contact.organisation));
            }
            else {
                this.add(new ContactPerso(contact.id, contact.profile, contact.firstname, contact.lastname, contact.phone, contact.email, contact.nickname, contact.location));
            }
        });
    };
    
    renderContactList = function (wrapper) {
        wrapper.innerHTML = '';
        this.list.forEach(contact => {
            let contactHtml = contact.renderContact(); 
            wrapper.appendChild(contactHtml);
            contactHtml.querySelector(`button[id^=speak]`).addEventListener("click", (event) => {
                contact.presentation();
            });
            contactHtml.querySelector(`button[id^=delete]`).addEventListener("click", (event) => {
                if (confirm(`Do you want to remove ${contact.firstname + " " + contact.lastname} from your contacts ?`)) {
                    contacts.remove(contact);
                    contacts.save();
                    contactHtml.remove();
                }
            });
            contactHtml.querySelector(`button[id^=edit]`).addEventListener("click", (event) => {
                let radioPerso = document.getElementById("edit-contact-type-perso");
                let radioPro = document.getElementById("edit-contact-type-pro");
                let editContactForm = document.getElementById('editContactForm');
                editContactForm["edit-contact-firstname"].value = contact.firstname;
                editContactForm["edit-contact-lastname"].value = contact.lastname;
                editContactForm["edit-contact-email"].value = contact.email;
                editContactForm["edit-contact-phone"].value = contact.phone;
                if (contact instanceof ContactPro) {
                    editContactForm["edit-contact-type"].value = "professional";
                    editContactForm["edit-contact-organisation"].value = contact.organisation;
                    handleTypeChange(radioPro);
                }
                else if (contact instanceof ContactPerso) {
                    editContactForm["edit-contact-type"].value = "personal";
                    editContactForm["edit-contact-nickname"].value = contact.nickname;
                    editContactForm["edit-contact-location"].value = contact.location;
                    handleTypeChange(radioPerso);
                }
                
                editContactForm.setAttribute("contact-id", contact.id);
            });
        });
    };
}

